A Magazine curated by. 
Studying the cover with @joel_meyerowitz “Curating AMagazine has been a project that means a lot to me. I was asked to tell a story , and I am not a canonic storyteller. Couture is my language:colours, fabrics and drawings have served my will to narrate for a long time. Now, having to translate my entire universe into an editorial work, I have started reflecting about everything I believe in, trying to evaluate my very thoughts about art, beauty, life and society.” Pp
